import React from "react";

function Vision() {

    return (
        <div className="visionBody">
            <h3 className="visionH3">Vår vision</h3>
            <p className="visionP">Våra medlemmar är experter som leder näringslivs- och samhälls­utvecklingen genom innovation och förädlingsprocesser. De driver skapandet av nästa generations hållbara byggnader, av framtidens infrastruktur och framtagandet av morgondagens tekniska och affärsmässiga lösningar. Innovations­företagens medlemmar står för en mycket stor del av den forskning och innovation som bedrivs inom arkitekt- och ingenjörsområdet i Sverige. På en global marknad är branschen en drivande aktör för att bidra med högkvalificerad kunskap och forskning till både näringsliv och offentlig sektor.
            </p>
        </div>
    );
}
export default Vision;
